import React, { Component } from 'react'
import {BrowserRouter as Router, Route} from 'react-router-dom'

import Home from '../pages/home'


export default class Body extends Component {
   
    render() {
        return (
            <Router>
                <Route exact path='/' render={<Home/>}/>
            </Router>
        )
    }
}
